        <div>
            <Container>
          <Row>

            <Col xs="8"><img  className="image1" src="https://i.imgur.com/Kckl5Qp.png" alt="touchdown"/><h3 className="flyM"><strong>Bobby McCain : THE FLYING MACHINE</strong></h3></Col>
            <Col xs="4" className="image2"><h5 className="news_title1"><strong>Latest News</strong></h5>
            <p>Intense Bobby McCain <br />
              The Blitz miami dolphins</p>
            </Col>

            </Row>
        </Container>
        </div> );
    }
}

export default News_zoom;
